import { BrowserRouter, Routes, Route } from "react-router-dom";
import Rootx from "./pages/Root";
import Login from "./users/Admin/Login";
import 'bootstrap/dist/css/bootstrap.min.css';
import Signup from "./users/Doctor/Signup";
import Tablex from "./"

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
        <Route path = "/" element = {<Rootx/>}/>
        <Route path = "/login" element = {<Login/>}/>
        <Route path = "/signup" element = {<Signup/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
